chrome.commands.onCommand.addListener((function(e){switch(e){case"toggle-fullscreen-mode":chrome.storage.local.get(["fullscreen"],(function(e){1==e.fullscreen?chrome.storage.local.set({fullscreen:!1}):chrome.storage.local.set({fullscreen:!0})}));break;case"toggle-force-default":chrome.storage.local.set({aspect_x:"1"}),chrome.storage.local.set({aspect_y:"1"});break;case"toggle-force-custom":chrome.storage.local.get(["aspect_x_custom","aspect_y_custom"],(function(e){chrome.storage.local.set({aspect_x:e.aspect_x_custom}),chrome.storage.local.set({aspect_y:e.aspect_y_custom})}));break;case"toggle-force-219":chrome.storage.local.set({aspect_x:"1.33"}),chrome.storage.local.set({aspect_y:"1"});break;case"toggle-force-329":chrome.storage.local.set({aspect_x:"2"}),chrome.storage.local.set({aspect_y:"1"});break;case"toggle-stretch":chrome.storage.local.set({aspect_y:"1"});break;case"toggle-crop":chrome.storage.local.get(["aspect_x"],(function(e){chrome.storage.local.set({aspect_y:e.aspect_x})}))}}));